query getCachedOriginsTopology(
  $zoneTag: string
  $dateFrom: Time
  $dateTo: Time
  $filterByCacheHit: [ZoneHttpRequestsAdaptiveGroupsFilter_InputObject!]
  $filterByUpperTierColos: [ZoneHttpRequestsAdaptiveGroupsFilter_InputObject!]
) {
  viewer {
    zones(filter: { zoneTag: $zoneTag }) {
      cachedRequests: httpRequestsAdaptiveGroups(
        filter: {
          datetime_geq: $dateFrom
          datetime_leq: $dateTo
          AND: [{ OR: $filterByCacheHit }, { OR: $filterByUpperTierColos }]
        }
        limit: 5000
        orderBy: [count_DESC]
      ) {
        count
        sum {
          edgeResponseBytes
        }
        dimensions {
          cacheStatus
          originIP
        }
      }
      totalRequests: httpRequestsAdaptiveGroups(
        filter: {
          datetime_geq: $dateFrom
          datetime_leq: $dateTo
          OR: $filterByUpperTierColos
        }
        limit: 5000
        orderBy: [count_DESC]
      ) {
        count
      }
    }
  }
}

query getTopOriginIps($zoneTag: string, $dateFrom: Time, $dateTo: Time) {
  viewer {
    zones(filter: { zoneTag: $zoneTag }) {
      topOriginIPs: httpRequestsAdaptiveGroups(
        filter: {
          datetime_geq: $dateFrom
          datetime_leq: $dateTo
          originIP_neq: ""
        }
        limit: 10
        orderBy: [count_DESC]
      ) {
        dimensions {
          originIP
        }
      }
    }
  }
}
